var openHealthDataApp=angular.module("openHealthDataApp",["ngRoute","ngAnimate","openHealthDataAppControllers"]);openHealthDataApp.config(["$routeProvider",function(a){a.when("/",{templateUrl:"partials/listView.html",controller:"restaurantListCtrl"}).when("/restaurants/:id",{templateUrl:"partials/restaurantDetailView.html",controller:"restaurantDetailCtrl"}).otherwise({redirectTo:"/"})}]);var openHealthDataAppControllers=angular.module("openHealthDataAppControllers",[]);openHealthDataAppControllers.controller("restaurantListCtrl",["$scope","$http",function(a,b){b.get("restaurants/restaurants.json").success(function(b){a.restaurants=b})}]),openHealthDataAppControllers.controller("restaurantDetailCtrl",["$scope","$routeParams","$http",function(a,b,c){c.get("restaurants/"+b.id+".json").success(function(b){a.restaurant=b})}]);